## CSS Stylesheets

You can create a separate CSS file for your component and import it into your component.

```jsx
// Button.jsx
import './Button.css';

const Button = () => {
  return <button className="btn">Click me</button>;
};
```

```css
/* Button.css */
.btn {
  background-color: #4caf50;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 4px;
  cursor: pointer;
}
```

## Inline Styling

You can use inline styles by passing a style object to the style prop.

```jsx
const Button = () => {
  return (
    <button
      style={{
        backgroundColor: '#4CAF50',
        color: 'white',
        padding: '10px 20px',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
      }}
    >
      Click me
    </button>
  );
};
```

## CSS Modules

CSS Modules allow you to write CSS that is scoped to a component, preventing class name collisions.

